  [],\n\t\"revision_timestamp\": \"2015-09-27T02:12:57.388437\",\n\t\"name\": \"ghrsst-level-4-g1sst-global-foundation-sea-surface-temperature-analysis-gds-version-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A Group for High Resolution Sea Surface
  Temperature (GHRSST) Level 4 sea surface temperature analysis produced daily on
  an operational basis by the JPL OurOcean group using a multi-scale two-dimensional
  variational (MS-2DVAR) blending algorithm on a global 0.009 degree grid. This Global
  1 km SST (G1SST) analysis uses satellite data from sensors that include the Advanced
  Very High Resolution Radiometer (AVHRR), the Advanced Along Track Scanning Radiometer
  (AATSR), the Spinning Enhanced Visible and Infrared Imager (SEVIRI), the Advanced
  Microwave Scanning Radiometer-EOS (AMSRE), the Tropical Rainfall Measuring Mission
  Microwave Imager (TMI), the Moderate Resolution Imaging Spectroradiometer (MODIS),
  the Geostationary Operational Environmental Satellite (GOES) Imager, the Multi-Functional
  Transport Satellite 1R (MTSAT-1R) radiometer, and in situ data from drifting and
  moored buoys.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
  \"180\"\n\t},\n\t{\n\t\t\"key\": \"resource-type\",\n\t\t\"value\": \"series\"\n\t},\n\t{\n\t\t\"key\":
